import React from 'react'
import classes from './MealItem.module.css'

const MealItem = ({ item }) => {
  return (
    <li className={classes.meal}>
      <h3>{item.name}</h3>
      <p className={classes.description}></p>
    </li>
  )
}

export default MealItem
